import React, { useState } from "react";
import styles from "./reserveBook.module.css";
import Navbar from "../../components/navbar/Navbar";
import { DateRange } from "react-date-range";
function ReserveBookPage() {
    const [date, setDate] = useState([
        {
            startDate: new Date(),
            endDate: new Date(),
            key: "selection",
        },
    ]);
    return (
        <div className={styles["reserve-book"]}>
            <Navbar />
            <div className={styles["reserve-container"]}>
                <div className={styles["top"]}>
                    <div className={styles["top-left"]}>
                        <h1>Hanoi</h1>
                        <p>
                            Lorem ipsum dolor, sit amet consectetur adipisicing
                            elit. Odit deserunt doloremque inventore minima
                            quidem enim cum eos obcaecati? Omnis, nostrum!
                        </p>
                    </div>
                    <div className={styles["top-right"]}>
                        <div>
                            <span className={styles.price}>$350</span> (1 night)
                        </div>
                        <button>Reserve or Book Now!</button>
                    </div>
                </div>

                {/* Form */}
                <div className={styles["reserve-form"]}>
                    <form action="#">
                        {/* date picker */}
                        <DateRange
                            editableDateInputs={true}
                            onChange={(item) => setDate([item.selection])}
                            moveRangeOnFirstSelection={false}
                            ranges={date}
                            className="date"
                            minDate={new Date()}
                        />
                    </form>
                </div>
            </div>
        </div>
    );
}

export default ReserveBookPage;
